export default async function importEntries() {
  for (const entry of entries) {
    // Map fields to match Supabase schema
    const insertObj = {
      id:  uuidv4(),
      userId: '20f55818-8f1e-40fe-a045-a7c891f2038f', // Fill this mapping!
      heading: note.heading,
      content: note.content,
      labelName: note.label || '',
      backgroundColor: note.backgroundColor || '',
      htmlContent: note.htmlContent || '',
      created_at: note.created_at || new Date().toISOString(),
    };

    const { error } = await supabase.from('notes').insert([insertObj]);
    if (error) {
      console.error('Error inserting note:', note._id, error);
    } else {
      console.log('Inserted note:', note._id);
    }
  }
  console.log('Import finished');
}
